def semi_join(relation1, relation2):
    """Performs a semi-join on relation1 using relation2."""
    keys_in_relation2 = set([t[0] for t in relation2])  # Assuming relation2 joins on the first column of relation1
    return [t for t in relation1 if t[1] in keys_in_relation2]


def join_relations(R1, R2):
    # Create a hashmap from R2 keyed by attribute B
    hashmap = {}
    for b,c in R2:
        if b in hashmap:
            hashmap[b].append(c)
        else:
            hashmap[b] = [c]

    # Perform the join operation
    result = []
    for t in R1:
        if t[len(t) -1] in hashmap:
            for c in hashmap[t[len(t) -1]]:
                t= [i for i in t]
                t.append(c)
                result.append(t)

    return result


def evaluate_chain_join(relations):
    """Evaluates a chain join for k relations."""
    # Semi-join reduction
    for i in range(0,len(relations) - 1):
        relations[i] = semi_join(relations[i], relations[i+1])
    for i in range(0,len(relations) - 1):
        result = relations[0]

    for i in range(1, len(relations)):
        result = join_relations(result, relations[i])


    return result


